import React from "react";
import rockstar from "./image/rockstar.png";
import "./Register.css";
import Entry from "./Entry";

const Register = () => {
  return (
    <div className="register-page">
      <div className="left_container">
        <img src={rockstar} alt="" />
      </div>
      <div className="right_container">
        <h1>Super App</h1>
        <p>Create your New Account </p>
        <div className="entry_tags">
          <Entry />
          <Entry />
          <Entry />
          <Entry />
        </div>
        <div>
          <input type="checkbox" name="" id="" />
          <p> Share my Registration data with Superapp</p>
        </div>
        <button>Sign UP</button>
        <p>By clicking on Sign up. you agree to Superapp <span>>Terms and Conditions of Use</span></p>
      </div>
    </div>
  );
};

export default Register;
